// MatchList.js
import React from 'react';
import matchData from '../Data/MatchData';

const MatchList = ({ onViewMatch, onGeneratePrediction }) => {
    return (
      <section className="p-4">
        <h2 className="text-xl font-bold mb-4">Maç Listesi</h2>
        <div className="grid grid-cols-1 sm:grid-cols-2 md:grid-cols-3 lg:grid-cols-4 gap-4">
          {matchData.map((match) => (
            <div key={match.id} className="border p-4">
              <div className="flex justify-between items-center mb-2">
                <div className="flex items-center">
                  <img src={match.team1.logo} alt={match.team1.name} className="w-8 h-8 mr-2" />
                  <p>{match.team1.name}</p>
                </div>
                <p>{match.date}</p>
                <div className="flex items-center">
                  <p>{match.team2.name}</p>
                  <img src={match.team2.logo} alt={match.team2.name} className="w-8 h-8 ml-2" />
                </div>
              </div>
              <div className="flex justify-between">
                <button onClick={() => onViewMatch(match.id)}>Maçı İncele</button>
                <button onClick={() => onGeneratePrediction(match.id)}>Tahmin Üret</button>
              </div>
            </div>
          ))}
        </div>
      </section>
    );
  };

  export default MatchList;
